import React, { useState } from 'react';
import 'react-calendar/dist/Calendar.css'; // css import

function Calendar() {
    const [value, onChange] = useState(new Date());

    return (
        <div>
        <Calendar onChange={onChange} value={value} />
        </div>
    );
}
export default Calendar
